// SPDX-License-Identifier: MIT


pragma solidity ^0.8.0;
contract FunctionIntro{
    function add (uint X, uint Y) external pure returns (uint) {
        return X + Y;
    }

    function sub (int X, int Y) external  pure returns (int)
{

        return X - Y;
}}

